import React from "react";
import { Transition } from "semantic-ui-react";

const ImageEdit = ({ Visble, Images, OnDelete }) => {
  const ImagesShow = Array.from(Images).map((Element, index) => {
    return <img className="ui large image" key={index} src={Element} />;
  });
  return (
    <div>
      <Transition animation="scale" visible={Visble}>
        {ImagesShow}
      </Transition>
    </div>
  );
};
export default ImageEdit;
